import { IconButton, Tooltip } from "@mui/material";
import React from "react";

const Add = () => {
  return (
    <>
      <Tooltip title="Delete">
        <Fab color="primary" aria-label="add">
          <AddIcon />
        </Fab>
      </Tooltip>
    </>
  );
};

export default Add;
